import { styled } from '@mui/system';
// import { AppbarHeight } from '../../library/common/constants';

export const CssCard = styled(Paper)(({ theme }) => ({
   cursor: 'pointer',
   zIndex: 100,
   boxShadow: '0px 4px 6px rgba(54, 78, 126, 0.101545)',
   padding: '24px 16px',
}));

export const CssTitle = styled(Typography)(({}));

